import React from 'react';

const SearchItem = () => {
  return (
    <div className='search-item'>
        <img src='http://brabbucontract.com/inspirations-and-ideas/wp-content/uploads/2019/06/fairmont-gold-royal-york-by-Champalimaud-Design.jpg'
        alt=''
        className='search-item-img' />
        <div className='search-item-description'>
            <h1 className='search-item-title'>Hotel Warsaw</h1>
            <p className='search-item-location'>Warsaw, Grzybowska 47A</p>
            <div className='search-item-details'>
                <p>1 bedroom</p>
                <p>1 living room</p>
                <p>1 bathroom</p>
                <p>1 kitchen</p>
                <p>2 beds (1 full, 1 sofa )</p>


            </div>
        </div>

    </div>
  );
}

export default SearchItem;
